// 'image', 64x64px
#include "carrier.h"
#include <assert.h>

typedef struct animation{
  uint16_t** frames;
  int frame_count;
  int frame_delay;
  int frame;
  unsigned long last_frame;
}animation_t;


animation_t* animation_create(int frame_count,int frame_delay){
  animation_t* animation = (animation_t*)calloc(1, sizeof(animation_t));
  animation->frames = (uint16_t**)calloc(frame_count + 1, sizeof(uint16_t*));
  animation->frame_count = frame_count;
  animation->frame_delay = frame_delay;
  animation->last_frame = 0;
  return animation;
}

bool animation_add_frame(animation_t* animation,uint16_t* image){
  int i = 0;
  while (animation->frames[i] != NULL){
    i++; 
    if (i > animation->frame_count) { 
      return false; 
    }
  }
  animation->frames[i] = image;
  return true;
}


void animation_step(animation_t* animation){
  if ((millis() - animation->last_frame) > animation->frame_delay){
    animation->frame = (++animation->frame > animation->frame_count || animation->frames[animation->frame] == NULL) ? 0 : animation->frame;
    animation->last_frame = millis();
  }
}

uint16_t* animation_get_frame(animation_t* animation){
  return *(animation->frames+animation->frame);
}

void animation_draw_frame(int x, int y,int size,animation_t* animation){
  carrier.display.drawRGBBitmap(x, y, animation_get_frame(animation), size, size);
}

